class Footer extends Component{
    render() {
        return (
            <footer className="page-footer font-small align-items-center justify-content-center" style={{color: "white", backgroundColor: "black", height: "50px"}}>
                <div className="text-center">
                    Coded by Jiehao Luo
                </div>
            </footer>
        )
    }
}

export default Footer;
